import "./App.css";
import "./styles/output.css";
import Header from "./components/Header";
import FooterChat from "./components/FooterChat";

function App() {
    return (
        <div
            class="flex flex-col h-screen"
            style={{
                fontFamily: "Helvetica Neue, Helvetica, Arial, sans-serif",
            }}
        >
            <Header />
            <Messages />
            <FooterChat />
        </div>
    );
}

export default App;
